import React from 'react'


const DataApi = 'https://api.covid19api.com/countries'
const itemData = [
    {
        span: "Strain",
        p: "SARS-CoV-2"
    },
    {
        span: "Symptoms",
        p: "Fever, Cough, Fatigue"
    },
    {
        span: "Usual onset",
        p: "2–14 days "
    },


]


export default function Headtitle() {
    return (
        <div className="items">
            <div className="item">
                {itemData.map((itemData, index) =>
                    <div key={index} className="item_list" >
                        <span>
                            {itemData.span}
                        </span>
                        <p>
                            {itemData.p}
                        </p>
                    </div>
                )}
            </div>
            <div>
                <div className='item-test'>
                    {
                        DataApi.map((item, index) =>
                            <div key={index} >
                                <select>
                                    <option>{item.Country}</option>
                                </select>
                            </div>
                        )
                    }
                </div>
            </div>

        </div>
    )
}
